import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Container, Typography, List, ListItem, ListItemText, Divider } from '@mui/material';

const ExamPage = () => {
  const [exams, setExams] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/api/exams')
      .then(res => {
        setExams(res.data);
        console.log('Exams loaded:', res.data);
      })
      .catch(err => {
        console.error('Error fetching exams:', err);
      });
  }, []);

  return (
    <Container sx={{ mt: 4 }}>
      <Typography variant="h5" gutterBottom>List of Competitive Exams</Typography>
      {exams.length === 0 ? (
        <Typography>No exams found.</Typography>
      ) : (
        <List>
          {exams.map((exam) => (
            <div key={exam.id}>
              <ListItem>
                <ListItemText
                  primary={exam.name}
                  secondary={exam.description}
                />
              </ListItem>
              <Divider />
            </div>
          ))}
        </List>
      )}
    </Container>
  );
};

export default ExamPage;
